  false,\n\t\"url\": null,\n\t\"notes\": \"<p>The Centers for Medicare and Medicaid
  Services (CMS) conducts and sponsors a number of innovative demonstration projects
  to test and measure the effect of potential program changes. Our demonstrations
  study the likely impact of new methods of service delivery, coverage of new types
  of service, and new payment approaches on beneficiaries, providers, health plans,
  states, and the Medicare Trust Funds. Evaluation projects validate our research
  and demonstration findings and help us monitor the effectiveness of Medicare, Medicaid,
  and the Childrens Health Insurance Program (CHIP).</p>n\",\n\t\"license_title\":
